snippet.textDisplay:
Mahesh bhatt ki film aayi thi DADDY. Usme ek gana hai, jiske bol kuch aise hain;

AAINA Mujhse Meri Pahli Si Surat Mange Mere Apne Mere hone Ki Nishani Mange

Itne Bade director clearly batate Hain Nahin lekin Kahin na kahin agar aap use gane ko sunenge to lagega Ki Jaise vah gana isi gane  ki tarz pe banaa hai.

